  handleInput = e => {
    let input = e.target.value;
    this.setState({ input });
  }

  handleClick = e => {
    let clickEvent = e.target.value;
    this.setState({ clickEvent });
  }

  render() {
    return (
      <>
      {/* <Header /> */}
      {/* <Form> */}
      {}
      <input onChange={this.handleInput} />

      <button onClick={this.handleClick}>Go!</button>
      {/* </Form> */}
      <Footer />

      </>
    )
  }
}

export default App;
